function [fitresult, gof] = createFit(Years, Keff)
%CREATEFIT(YEARS,KEFF)
%  Create a fit.
%
%  Data for 'Multiplication Constant Estimate' fit:
%      X Input : Years
%      Y Output: Keff
%  Output:
%      fitresult : a fit object representing the fit.
%      gof : structure with goodness-of fit info.
%
