%  Auto-generated by MATLAB on 11-Mar-2023 18:38:41


%% Fit: 'Multiplication Constant Estimate'.
[xData, yData] = prepareCurveData( Years, Keff );

% Set up fittype and options.
ft = fittype( 'exp2' );
opts = fitoptions( 'Method', 'NonlinearLeastSquares' );
opts.Display = 'Off';
opts.StartPoint = [1.12452015939298 -0.000493578792867439 -0.119465399299258 -0.00645829083770484];

% Fit model to data.
[fitresult, gof] = fit( xData, yData, ft, opts );

